  }
`;

export default function Exchange({ name }) {
  return (
    <ExchangeStyles>
      <div className='exchange__container'>
        <div className='exchange__title'>
          <h1 className='title'>hello</h1>
        </div>
      </div>
    </ExchangeStyles>
  );
}
